SELECT ?property ?hasValue ?isValueOf
WHERE {
  { <http://dbpedia.org/resource/A_Drama_in_Livonia> ?property ?hasValue }
  UNION
  { ?isValueOf ?property <http://dbpedia.org/resource/A_Drama_in_Livonia> }
}

